import React from 'react';
import {Link} from "react-router-dom";
import {useSelector} from "react-redux";

function Header (props) {
        return (

            <div>
                <nav className="navbar navbar-expand-lg navbar-light bg-light shadow">
                    <i role="button" className="ml-4 fas fa-bars fa-lg" onClick={this.toggleSidebar}></i>
                    <Link to="/" className="ml-4 navbar-brand">E-Commerce</Link>
                    <div className="collapse navbar-collapse" id="navbarTogglerDemo02">
                        <ul className="navbar-nav ml-auto mt-2 mt-lg-0">
                            <li className="nav-item mr-4">
                                <a className="nav-link" href="#">Cart <span className="sr-only">(current)</span></a>
                            </li>
                            <li className="nav-item mr-4">
                                {
                                    userInfo ? <Link to="/signin" className="nav-link">{userInfo.name}</Link>
                                        :
                                        <Link to="/signin" className="nav-link">Sign In</Link>
                                }
                            </li>
                        </ul>
                    </div>
                </nav>

                <aside id="sidebar">
                    <p>first row</p>
                    <p>first row</p>
                    <p>first row</p>
                </aside>
            </div>
        )
}

export default Header;
